import React, { useState, useEffect } from 'react';
import { useAdmin } from '../context/adminContext';
import { useNavigate } from 'react-router-dom';
import { 
  getAdminPanelRequest, 
  getProductsRequest, 
  getLogsRequest, 
  addProductRequest, 
  deleteProductRequest, 
  deleteUserRequest 
} from '../AuthP/admin.api';

const PanelAdmin = () => {
  const [usuarios, setUsuarios] = useState([]);
  const [productos, setProductos] = useState([]);
  const [registros, setRegistros] = useState([]);
  const [error, setError] = useState(null);
  const { esAdmin, cargando } = useAdmin();
  const navegar = useNavigate();

  const [paginaUsuarios, setPaginaUsuarios] = useState(1);
  const [paginaProductos, setPaginaProductos] = useState(1);
  const elementosPorPagina = 5;

  useEffect(() => {
    if (!cargando && esAdmin) {
      console.log('Usuario es admin, cargando datos');
      obtenerDatos();
    } else if (!cargando && !esAdmin) {
      console.log('Usuario no es admin, redirigiendo a /signin');
      navegar('/signin');
    }
  }, [esAdmin, cargando, navegar]);

  const obtenerDatos = async () => {
    try {
      const [respuestaPanelAdmin, respuestaProductos, respuestaRegistros] = await Promise.all([
        getAdminPanelRequest(),
        getProductsRequest(),
        getLogsRequest(),
      ]);
      console.log('Respuesta Panel Admin:', respuestaPanelAdmin.data);
      console.log('Respuesta Productos:', respuestaProductos.data);
      console.log('Respuesta Registros:', respuestaRegistros.data);
  
      setUsuarios(respuestaPanelAdmin.data.users || []);
      setProductos(respuestaProductos.data.products || []);
      setRegistros(respuestaRegistros.data.logs || []);
      setError(null);
    } catch (error) {
      console.error('Error al obtener datos', error);
      setError('Error al cargar los datos. Por favor, intente de nuevo más tarde.');
      setUsuarios([]);
      setProductos([]);
      setRegistros([]);
    }
  };

  const handleAgregarProducto = async (event) => {
    event.preventDefault();
    const formData = new FormData(event.target);
    try {
      await addProductRequest(formData);
      // Recargar productos después de agregar
      const respuestaProductos = await getProductsRequest();
      setProductos(respuestaProductos.data.products || []);
    } catch (error) {
      console.error('Error al agregar producto', error);
      setError('Error al agregar el producto. Por favor, intente de nuevo.');
    }
  };

  const handleEliminarProducto = async (id) => {
    try {
      await deleteProductRequest(id);
      setProductos(productos.filter(producto => producto.id !== id));
    } catch (error) {
      console.error('Error al eliminar producto', error);
      setError('Error al eliminar el producto. Por favor, intente de nuevo.');
    }
  };

  const handleEliminarUsuario = async (id) => {
    try {
      await deleteUserRequest(id);
      setUsuarios(usuarios.filter(usuario => usuario.id !== id));
    } catch (error) {
      console.error('Error al eliminar usuario', error);
      setError('Error al eliminar el usuario. Por favor, intente de nuevo.');
    }
  };

  const paginaAnteriorUsuarios = () => {
    setPaginaUsuarios(prev => Math.max(prev - 1, 1));
  };

  const paginaSiguienteUsuarios = () => {
    setPaginaUsuarios(prev => (prev * elementosPorPagina < usuarios.length ? prev + 1 : prev));
  };

  const paginaAnteriorProductos = () => {
    setPaginaProductos(prev => Math.max(prev - 1, 1));
  };

  const paginaSiguienteProductos = () => {
    setPaginaProductos(prev => (prev * elementosPorPagina < productos.length ? prev + 1 : prev));
  };

  const usuariosPaginados = usuarios.slice((paginaUsuarios - 1) * elementosPorPagina, paginaUsuarios * elementosPorPagina);
  const productosPaginados = productos.slice((paginaProductos - 1) * elementosPorPagina, paginaProductos * elementosPorPagina);

  if (cargando) {
    return <div>Cargando...</div>;
  }

  if (!esAdmin) {
    return null;
  }

  return (
    <div className="container p-4">
      <h1>Panel de Administración</h1>
      {error && (
        <div className="alert alert-danger" role="alert">
          {error}
        </div>
      )}

      {/* Formulario para agregar producto */}
      <div className="card bg-dark text-light mb-4">
        <div className="card-body">
          <h4 className="card-title mb-3">Agregar Nuevo Producto</h4>
          <form onSubmit={handleAgregarProducto}>
            <div className="form-group mb-3">
              <input type="text" name="name" className="form-control bg-dark text-light" placeholder="Nombre del producto" required />
            </div>
            <div className="form-group mb-3">
              <textarea name="description" className="form-control bg-dark text-light" placeholder="Descripción" required></textarea>
            </div>
            <div className="form-group mb-3">
              <input type="number" name="price" step="0.01" className="form-control bg-dark text-light" placeholder="Precio" required />
            </div>
            <div className="form-group mb-3">
              <input type="number" name="quantity" className="form-control bg-dark text-light" placeholder="Cantidad" required />
            </div>
            <button type="submit" className="btn btn-primary">Agregar Producto</button>
          </form>
        </div>
      </div>

      {/* Listado de Usuarios */}
      <div className="card bg-dark text-light mb-4">
        <div className="card-body">
          <h4 className="card-title mb-3">Listado de Usuarios</h4>
          {usuarios.length > 0 ? (
            <div className="table-responsive">
              <table className="table table-dark table-striped">
                <thead>
                  <tr>
                    <th>ID</th>
                    <th>Nombre</th>
                    <th>Email</th>
                    <th>Acciones</th>
                  </tr>
                </thead>
                <tbody>
                  {usuariosPaginados.map(usuario => (
                    <tr key={usuario.id}>
                      <td>{usuario.id}</td>
                      <td>{usuario.name}</td>
                      <td>{usuario.email}</td>
                      <td>
                        <button className="btn btn-danger" onClick={() => handleEliminarUsuario(usuario.id)}>Eliminar</button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
              <nav>
                <ul className="pagination justify-content-center">
                  <li className={`page-item ${paginaUsuarios === 1 ? 'disabled' : ''}`}>
                    <button className="page-link" onClick={paginaAnteriorUsuarios}>Anterior</button>
                  </li>
                  <li className="page-item">
                    <button className="page-link" onClick={paginaSiguienteUsuarios}>Siguiente</button>
                  </li>
                </ul>
              </nav>
            </div>
          ) : (
            <p>No hay usuarios disponibles.</p>
          )}
        </div>
      </div>

      {/* Listado de Productos */}
      <div className="card bg-dark text-light mb-4">
        <div className="card-body">
          <h4 className="card-title mb-3">Listado de Productos</h4>
          {productos.length > 0 ? (
            <div className="table-responsive">
              <table className="table table-dark table-striped">
                <thead>
                  <tr>
                    <th>ID</th>
                    <th>Nombre</th>
                    <th>Descripción</th>
                    <th>Precio</th>
                    <th>Cantidad</th>
                    <th>Acciones</th>
                  </tr>
                </thead>
                <tbody>
                  {productosPaginados.map(producto => (
                    <tr key={producto.id}>
                      <td>{producto.id}</td>
                      <td>{producto.name}</td>
                      <td>{producto.description}</td>
                      <td>{producto.price}</td>
                      <td>{producto.quantity}</td>
                      <td>
                        <button className="btn btn-danger" onClick={() => handleEliminarProducto(producto.id)}>Eliminar</button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
              <nav>
                <ul className="pagination justify-content-center">
                  <li className={`page-item ${paginaProductos === 1 ? 'disabled' : ''}`}>
                    <button className="page-link" onClick={paginaAnteriorProductos}>Anterior</button>
                  </li>
                  <li className="page-item">
                    <button className="page-link" onClick={paginaSiguienteProductos}>Siguiente</button>
                  </li>
                </ul>
              </nav>
            </div>
          ) : (
            <p>No hay productos disponibles.</p>
          )}
        </div>
      </div>

      {/* Listado de Registros */}
      <div className="card bg-dark text-light">
        <div className="card-body">
          <h4 className="card-title mb-3">Listado de Registros</h4>
          {registros.length > 0 ? (
            <div className="table-responsive">
              <table className="table table-dark table-striped">
                <thead>
                  <tr>
                    <th>ID</th>
                    <th>Usuario</th>
                    <th>Acción</th>
                    <th>Fecha</th>
                  </tr>
                </thead>
                <tbody>
                  {registros.map(registro => (
                    <tr key={registro.id}>
                      <td>{registro.id}</td>
                      <td>{registro.user}</td>
                      <td>{registro.action}</td>
                      <td>{registro.date}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          ) : (
            <p>No hay registros disponibles.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default PanelAdmin;
